def fillWithGrid(text: str, fill: str, startX: int, starty: int):
    lines = text.split("\n")
    for y in range(len(fill.split("\n"))):
        for x in range(len(fill.split("\n")[0])):
            lines[starty+y] = lines[starty+y][:startX+x] + \
                fill.split("\n")[y][x]+lines[starty+y][startX+x+1:]
    return "\n".join(lines)


